import React, {Component} from "react";
import {NavLink} from "react-router-dom";
import button from "./button";

const PaBtn = () => {
    return (
        <button type="button"
                className="text-white text-lg rounded-full bg-tahiti hover:bg-tahiti-dark py-5 px-8">Личный
            кабинет</button>
    )
}

PaBtn.addEventListener("click", (e) => {
    e.preventDefault();
console.log("Jello")
})
const Navbar = () => {
    // let navClasses = "";

    return (
        <nav className="bg-black-transparent w-9/12 rounded-full mx-auto p-1.5">
            <div className="my-5 mx-2">
                <PaBtn/>
            </div>
        </nav>
    )
}

export default Navbar;
